	(9, 'Платье', '2012-08-16 17:31:49', '2012-08-29 13:20:39', 'Очень эффектное стандартное платье, элегантный чёрный цвет, летящие крылья, много камней и потрясающий покров, который пойдёт на любую фигуру. Платье очень быстро снимается и надевается. На шее и спине есть украшение, которое вшито в платье. Особенность платья в том, что оно сшито в Англии и не выступало два года. ', 'Стандартное', 'Света', 'clairekuzn@mail.ru', 'Взрослые', 'чёрный', '42-46', '170-180', 'очень много', ' в Англии', 'отличное, английское качество', '16 000 руб (торг уместен)', '', '89262809860', '', 'звоните и можно будет договориться', 'dress-photos/091212sb030.jpg', 'Великолепные, летящие крылья сразу бросаются в глаза. Элегантный силуэт не оставит равнодушным судей ', 0, 0, 0, 1, 'QdVXKL', 86, 5, 2, 6),
	(10, 'Платье', '2012-08-16 18:04:32', '2012-08-29 20:47:57', 'Прекрасная чёрная латина, очень эффектное и необычное платье, одновременно, изящный и всегда модный чёрный цвет позволяет платью быть неповторимым и актуальным на паркете одновременно. У платья очень красивое кружево, прекрасный корсет и красивые аксессуары', 'Латинское', 'Света', 'clairekuzn@mail.ru', 'Взрослые', 'чёрный', '44-46', 'от 170 и выше', 'много, всё платье в камнях', 'в Костюмере', 'идеальное', '25 000 руб.', '', '89262809860', '', 'могу привезти куда Вам удобно', 'dress-photos/14_2.jpg', 'Летящая юбка, прекрасный корсет, перчатки, ошейник-колье и 10 браслетов в наборе', 0, 0, 0, 1, 'UKkYiP', 113, 9, 2, 10),
	(11, 'Платье', '2012-08-16 18:14:52', '2012-08-29 13:21:05', 'Голубое стандартное платье, великолепная пышная юбка, верх платья полностью по силуэту, красивые летящие шарфики, очень лёгкое и элегантное платье, пояс украшен кружевом', 'Стандартное', 'Света', 'clairekuzn@mail.ru', 'Взрослые', 'светло-голубое', '44-46', 'от 170', 'одна пачка', 'Москва', 'отличное', '10 000 руб.', '', '89262809860', '', 'могу привезти, куда вам удобно', 'dress-photos/img173_1.jpg', 'Нежное, объёмное, замечательное платье', 0, 0, 0, 1, 'lZVrtx', 75, 9, 2, 10),
	(12, 'Платье', '2012-08-16 18:23:49', '2012-08-30 23:47:18', 'Профессиональное, необычное, яркое, очень заметное и естественное платье. Два комплекта шарфиков. Огромное количество камней - весь верх усеян голубыми камнями. Удобная и пышная юбка. Платье полностью по силуэту.', 'Стандартное', 'Света ', 'clairekuzn@mail.ru', 'Взрослые', 'нежно голубой', '42-44', 'от 170', 'огромное количество', 'профессиональное отелье', 'идеальное', '35 000 руб.', '', '89262809860', '', 'звоните, я могу привезти, куда вам удобно', 'dress-photos/z_ea404bc5_1.jpg', 'Очень большое количество камней наклеено на сетку, эффектные шарфики, есть украшение на шею.', 0, 0, 0, 1, 'THmeSH', 95, 8, 2, 10),
